INSERT INTO `problems` (`problemId`, `problemName`, `problemDescription`, `inputDescription`, `outputDescription`, `constraintDescription`, `inputExample`, `outputExample`, `notes`, `cpuTimeLimit`, `memoryLimit`, `userId`, `problemAddedDate`) VALUES
(1, ' A + B', '<p>You are given two integer A and B. Find summation of A and B .</p>\n', 'You will be given an integer&nbsp;<strong>T</strong>&nbsp;(<span class=\"equation\">\\(1\\leq T \\leq 10^3\\)</span>) in the first line. In next T lines there will be two integer <strong>A,B</strong>&nbsp;(<span class=\"equation\">\\(1\\leq A,B \\leq 10^{12}\\)</span>).', 'For each test case, print the summation of <strong>A</strong> and <strong>B</strong>.', '<span class=\"equation\">\\(1\\leq T \\leq 10^3\\)</span><br />\n<span class=\"equation\">\\(1\\leq A,B \\leq 10^{12}\\)</span>', '3<br />\n1 2<br />\n2 3<br />\n4 5', 'Case 1: 3<br />\nCase 2: 5<br />\nCase 3: 9', '', 1.4, 12800, 1, '2020-01-24 00:00:00'),
(3, 'Bangladesh Strong In Math', '<p>In the wilds far beyond lies the Land of Sacredness, which can be viewed as a tree &nbsp;&mdash; connected undirected graph consisting of&nbsp;nn&nbsp;nodes and&nbsp;n&minus;1n&minus;1&nbsp;edges. The nodes are numbered from&nbsp;11&nbsp;to&nbsp;nn.</p>\n\n<p>There are&nbsp;mm&nbsp;travelers attracted by its prosperity and beauty. Thereupon, they set off their journey on this land. The&nbsp;ii-th traveler will travel along the shortest path from&nbsp;sisi&nbsp;to&nbsp;titi. In doing so, they will&nbsp;go through&nbsp;all edges in the shortest path from&nbsp;sisi&nbsp;to&nbsp;titi, which is unique in the tree.</p>\n\n<p>During their journey, the travelers will acquaint themselves with the others. Some may even become friends. To be specific, the&nbsp;ii-th traveler and the&nbsp;jj-th traveler will become friends if and only if there are&nbsp;at least&nbsp;kk&nbsp;edges that both the&nbsp;ii-th traveler and the&nbsp;jj-th traveler will&nbsp;go through.</p>\n\n<p>Your task is to find out the number of pairs of travelers&nbsp;(i,j)(i,j)&nbsp;satisfying the following conditions:</p>\n\n<ul>\n <li>1&le;i&lt;j&le;m1&le;i&lt;j&le;m.</li>\n  <li>the&nbsp;ii-th traveler and the&nbsp;jj-th traveler will become friends.</li>\n</ul>\n', 'The first line contains three integers&nbsp;nn,&nbsp;mm&nbsp;and&nbsp;kk&nbsp;(2&le;n,m&le;1.5&sdot;1052&le;n,m&le;1.5&sdot;105,&nbsp;1&le;k&le;n1&le;k&le;n).<br />\nEach of the next&nbsp;n&minus;1n&minus;1&nbsp;lines contains two integers&nbsp;uu&nbsp;and&nbsp;vv&nbsp;(1&le;u,v&le;n1&le;u,v&le;n), denoting there is an edge between&nbsp;uu&nbsp;and&nbsp;vv.<br />\nThe&nbsp;ii-th line of the next&nbsp;mm&nbsp;lines contains two integers&nbsp;sisi&nbsp;and&nbsp;titi&nbsp;(1&le;si,ti&le;n1&le;si,ti&le;n,&nbsp;si&ne;tisi&ne;ti), denoting the starting point and the destination of&nbsp;ii-th traveler.<br />\nIt is guaranteed that the given edges form a tree.', '<br />\nThe only line contains a single integer &nbsp;&mdash; the number of pairs of travelers satisfying the given conditions.', '', '8 4 1<br />\n1 7<br />\n1 2<br />\n2 5<br />\n4 6<br />\n6 3<br />\n6 2<br />\n6 8<br />\n7 8<br />\n3 8<br />\n2 6<br />\n4 1<br />\n&nbsp;', '4', '<p><img alt=\"\" height=\"74\" src=\"https://espresso.codeforces.com/238216da68c34b418571920cacddd6194f408878.png\" width=\"800\" /></p>\n\n<p>In the first example there are&nbsp;44&nbsp;pairs satisfying the given requirements:&nbsp;(1,2)(1,2),&nbsp;(1,3)(1,3),&nbsp;(1,4)(1,4),&nbsp;(3,4)(3,4).</p>\n\n<ul>\n <li>The&nbsp;11-st traveler and the&nbsp;22-nd traveler both go through the edge&nbsp;6&minus;86&minus;8.</li>\n  <li>The&nbsp;11-st traveler and the&nbsp;33-rd traveler both go through the edge&nbsp;2&minus;62&minus;6.</li>\n  <li>The&nbsp;11-st traveler and the&nbsp;44-th traveler both go through the edge&nbsp;1&minus;21&minus;2&nbsp;and&nbsp;2&minus;62&minus;6.</li>\n <li>The&nbsp;33-rd traveler and the&nbsp;44-th traveler both go through the edge&nbsp;2&minus;62&minus;6.</li>\n</ul>\n', 0.2, 128000, 7, '2020-02-27 16:44:11'),
(10, 'Bangladesh Play', '<p>Write a program which reads a rectangle and a circle, and determines whether the circle is arranged inside the rectangle. As shown in the following figures, the upper right coordinate&nbsp;(W,H)(W,H)&nbsp;of the rectangle and the central coordinate&nbsp;(x,y)(x,y)&nbsp;and radius&nbsp;rr&nbsp;of the circle are given.</p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"Circle inside a rectangle\" src=\"http://judge.u-aizu.ac.jp/onlinejudge/IMAGE2/circle_and_rectangle.png\" />\n<figcaption>Follow this system</figcaption>\n</figure>\n</div>\n\n<p>&nbsp;</p>\n', 'Five integers&nbsp;WW,&nbsp;HH,&nbsp;xx,&nbsp;yy&nbsp;and&nbsp;rr&nbsp;separated by a single space are given in a line.', 'Print &quot;Yes&quot; if the circle is placed inside the rectangle, otherwise &quot;No&quot; in a line.', '<span class=\"equation\">\\(-100 \\leq x,y \\leq 100\\)</span><br />\n<span class=\"equation\">\\(0 &lt; W,H,r \\leq 100\\)</span>', '5<br />\n4<br />\n2<br />\n2<br />\n1', 'Yes', '', 3, 12800, 1, '2020-03-01 23:19:11'),
